import React from 'react';
import {
  SafeAreaView,
  StyleSheet,
  View,
  Text,
  TextInput,
  TouchableOpacity,
  Animated,
  Easing,
} from 'react-native';
import { 
  useFonts,
  Orbitron_400Regular,
  Orbitron_500Medium,
  Orbitron_600SemiBold,
  Orbitron_700Bold,
} from '@expo-google-fonts/orbitron';
import Svg, { Path } from 'react-native-svg';

const App = () => {
  let [fontsLoaded] = useFonts({
    Orbitron_400Regular,
    Orbitron_500Medium,
    Orbitron_600SemiBold,
    Orbitron_700Bold,
  });

  const spinValue = new Animated.Value(0);

  const onHoverIn = () => {
    Animated.timing(spinValue, {
      toValue: 1,
      duration: 3000,
      easing: Easing.linear,
      useNativeDriver: true,
    }).start();
  };

  const onHoverOut = () => {
    Animated.timing(spinValue, {
      toValue: 0,
      duration: 3000,
      easing: Easing.linear,
      useNativeDriver: true,
    }).start();
  };

  const spin = spinValue.interpolate({
    inputRange: [0, 1],
    outputRange: ['0deg', '180deg']
  });

  if (!fontsLoaded) {
    return null;
  }

  return (
    <SafeAreaView style={styles.container}>
      {/* Header */}
      <View style={styles.header}>
        <Text style={styles.logo}>EVE</Text>
        <View style={styles.headerRight}>
          <Text style={styles.balance}>EVE: $0.0150</Text>
          <TouchableOpacity style={styles.menuButton}>
            <Text style={styles.menuText}>Menu</Text>
          </TouchableOpacity>
        </View>
      </View>

      {/* Split Container Layout */}
      <View style={styles.splitContainer}>
        {/* Left Container */}
        <View style={styles.leftContainer}>
          <Text style={styles.title}>Meet EVE</Text>
          <View style={styles.subtitleContainer}>
            <Text style={styles.subtitle}>your crypto-native</Text>
            <Text style={styles.subtitle}>Personal Agent.</Text>
          </View>

          {/* Whitelist Section */}
          <View style={styles.whitelistSection}>
            <Text style={styles.whitelistTitle}>Join the whitelist</Text>
            <TextInput
              style={styles.input}
              placeholder="Telegram handle"
              placeholderTextColor="#666"
            />
          </View>
        </View>

        {/* Right Container */}
        <View style={styles.rightContainer}>
          <Animated.View 
            style={{ 
              transform: [
                { perspective: 1000 },
                { rotateY: spin }
              ],
            }}
            onMouseEnter={onHoverIn}
            onMouseLeave={onHoverOut}
          >
            <Svg width={300} height={326} viewBox="0 0 300 326" fill="none">
              {/* Front faces (original) */}
              <Path d="M7.63957 156.567L78.9963 190.399L140.652 311.658L7.63957 156.567Z" fill="#2C1A0B" stroke="#F4E409" strokeWidth="4"/>
              <Path d="M3.41363 150.136L144.961 7.89866L79.349 186.138L3.41363 150.136Z" fill="#A3930A" stroke="#F4E409" strokeWidth="4"/>
              <Path d="M83.63 190.685L294.858 177.229L150.531 322.259L83.63 190.685Z" fill="#A3930A" stroke="#F4E409" strokeWidth="4"/>
              <Path d="M83.4075 186.692L150.7 3.88822L295.872 173.157L83.4075 186.692Z" fill="#2C1A0B" stroke="#F4E409" strokeWidth="4"/>

              {/* Back faces (mirrored) */}
              <Path d="M140.652 311.658L78.9963 190.399L294.858 177.229L140.652 311.658Z" fill="#1A1205" stroke="#F4E409" strokeWidth="4"/>
              <Path d="M144.961 7.89866L295.872 173.157L79.349 186.138L144.961 7.89866Z" fill="#826F08" stroke="#F4E409" strokeWidth="4"/>
              <Path d="M3.41363 150.136L7.63957 156.567L140.652 311.658L79.349 186.138L3.41363 150.136Z" fill="#826F08" stroke="#F4E409" strokeWidth="4"/>
              <Path d="M295.872 173.157L294.858 177.229L150.531 322.259L150.7 3.88822L295.872 173.157Z" fill="#1A1205" stroke="#F4E409" strokeWidth="4"/>
            </Svg>
          </Animated.View>
        </View>
      </View>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#0A0A0A',
  },
  header: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    paddingVertical: 20,
    paddingHorizontal: 40,
    borderBottomWidth: 1,
    borderBottomColor: '#333',
  },
  logo: {
    fontSize: 24,
    color: '#fff',
    fontWeight: '200',
    letterSpacing: 2,
    fontFamily: 'Orbitron_400Regular',
  },
  headerRight: {
    flexDirection: 'row',
    alignItems: 'center',
    gap: 20,
  },
  balance: {
    color: '#B8860B',
    backgroundColor: '#1A1A1A',
    padding: 8,
    borderRadius: 4,
    fontSize: 14,
    letterSpacing: 0.5,
    fontFamily: 'Orbitron_400Regular',
  },
  menuButton: {
    borderWidth: 1,
    borderColor: '#B8860B',
    padding: 8,
    borderRadius: 4,
  },
  menuText: {
    color: '#B8860B',
    fontSize: 14,
    letterSpacing: 0.5,
    fontFamily: 'Orbitron_400Regular',
  },
  splitContainer: {
    flex: 1,
    flexDirection: 'row',
  },
  leftContainer: {
    flex: 1,
    paddingLeft: '10%',
    paddingTop: 80,
    justifyContent: 'flex-start',
  },
  rightContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  title: {
    fontSize: 64,
    color: '#fff',
    marginBottom: 20,
    fontWeight: '200',
    letterSpacing: 2,
    fontFamily: 'Orbitron_400Regular',
  },
  subtitleContainer: {
    marginBottom: 60,
  },
  subtitle: {
    fontSize: 48,
    color: '#fff',
    lineHeight: 56,
    fontWeight: '200',
    letterSpacing: 1,
    fontFamily: 'Orbitron_400Regular',
  },
  whitelistSection: {
    width: '100%',
    maxWidth: 400,
    marginTop: 60,
  },
  whitelistTitle: {
    color: '#fff',
    fontSize: 32,
    marginBottom: 20,
    fontWeight: '200',
    letterSpacing: 1,
    fontFamily: 'Orbitron_400Regular',
  },
  input: {
    borderWidth: 1,
    borderColor: '#B8860B',
    color: '#fff',
    padding: 15,
    borderRadius: 4,
    width: '100%',
    backgroundColor: 'transparent',
    fontSize: 16,
    letterSpacing: 0.5,
  },
});

export default App;
